export const addToBookmark = ({ allBookmarks }, addToBookmarkItem) => {
  const existsInBookmarks = allBookmarks.allBookmarks.find(
    (bookmarkItem) =>
      allBookmarks.allBookmarks.bookmarkItem.id ===
      allBookmarks.allBookmarks.addToBookmarkItem.id
  );

  if (existsInBookmarks) {
    console.log(allBookmarks.id);
  } else {
    console.log("error");
  }
};
